// src/components/NiveisList.js
import React from 'react';

function NiveisList({ niveis }) {
  return (
    <div>
      <h2>Lista de Níveis</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Nível</th>
            <th>Ações</th>
          </tr>
        </thead>
        <tbody>
          {niveis.map(nivel => (
            <tr key={nivel.id}>
              <td>{nivel.id}</td>
              <td>{nivel.nivel}</td>
              <td>
                {/* Botões de editar e excluir */}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default NiveisList;
